import math

def generate_primes(n):
    if n < 1:
        return []
    else:
        sieve = [True] * (n + 1)
        for x in range(2, int(math.sqrt(n)) + 1):
            if sieve[x]:
                for i in range(x * x, n + 1, x):
                    sieve[i] = False
        return [i for i in range(2, n) if sieve[i]]

